"use strict";$(document).ready(function(){$("#root").append('<section class="organs">\n                            <input class="inputer" type=\'text\' />\n                            <button class="btn waves-effect waves-light btn-large">click</button>\n                        </section>\n                        <ul class="out"></ul>'),$(".btn").click(function(){var n="https://en.wikipedia.org/w/api.php?action=opensearch&search="+$(".inputer").val()+"&format=json&callback=?";$.ajax({type:"GET",url:n,async:!1,dataType:"json",beforeSend:function(){$(".out").prepend('<div class="preloader-wrapper small active">\n                        <div class="spinner-layer spinner-green-only">\n                        <div class="circle-clipper left">\n                            <div class="circle"></div>\n                        </div><div class="gap-patch">\n                            <div class="circle"></div>\n                        </div><div class="circle-clipper right">\n                            <div class="circle"></div>\n                        </div>\n                        </div>\n                    </div>')},success:function(n){$(".out").html("");for(var c=0;c<n.length;c++)$(".out").append('<div class="row">\n                                            <div class="col m12">\n                                                <div class="card blue-grey darken-1">\n                                                    <div class="card-content white-text">\n                                                        <span class="card-title">'+n[1][c]+"</span>\n                                                        <p>"+n[2][c]+'</p>\n                                                    </div>\n                                                    <div class="card-action">\n                                                        <a href='+n[3][c]+' target="_blank">See</a>\n                                                    </div>\n                                                </div>\n                                            </div>\n                                        </div>')},error:function(n){alert("error")}})}),$(".inputer").keypress(function(n){13==n.which&&$(".btn").click()})});